def solve():
    t = int(input())
    for _ in range(t):
        n, k = map(int, input().split())
        s = input()
        b_count = s.count('B')
        if b_count >= k:
            print(0)
        else:
            diff = k - b_count
            start = 0
            end = n - 1
            while start < end:
                mid = (start + end) // 2
                if s[:mid + 1].count('B') >= diff:
                    end = mid
                else:
                    start = mid + 1
            print(start + 1)
            if s[:start].count('B') >= diff:
                print('B')
            else:
                print('A')
            print('1 B')

