def solve():
    t = int(input())
    for _ in range(t):
        pin = input()
        visited = set()
        queue = [(0, 0, 0, 0)]
        visited.add((0, 0))
        while queue:
            x, y, step, total = queue.pop(0)
            if x == 3:
                print(total + 1)
                break
            for i in range(10):
                nx, ny = x, y
                if i == int(pin[x]):
                    nx = x
                    ny = y + 1
                elif i == int(pin[y]):
                    nx = x + 1
                    ny = y
                elif i == int(pin[x-1]):
                    nx = x - 1
                    ny = y
                elif i == int(pin[x+1]):
                    nx = x + 1
                    ny = y
                if (nx, ny) not in visited:
                    visited.add((nx, ny))
                    queue.append((nx, ny, step + 1, total + 1 + abs(nx - x) + abs(ny - y)))

