    for _ in range(t):
        n, m = map(int, input().split())
        a = list(map(int, input().split()))
        b = list(map(int, input().split()))
        a.sort(reverse=True)
        b.sort(reverse=True)
        i = 0
        j = 0
        while i < n and j < m:
            if a[i] > b[j]:
                i += 1
                j += 1
            else:
                i += 1
        if i == n:
            print("Tenzing")
        elif j == m:
            print("Tsondu")
        else:
            print("Draw")

