def solve():
    t = int(input())
    for _ in range(t):
        n, m = map(int, input().split())
        p = list(map(int, input().split()))
        ans = [-1] * n
        seen = set()
        for i in range(m):
            if p[i] <= n:
                ans[p[i] - 1] = i + 1
            else:
                if p[i] not in seen:
                    seen.add(p[i])
                    ans[0] = i + 1
                    for j in range(n - 1):
                        if p[i] in seen:
                            ans[j] = -1
                        else:
                            seen.add(p[i])
                            ans[j] = i + 1
                            p[i], p[i - 1] = p[i - 1], p[i]
        print(*ans)

