def solve():
    t = int(input())
    for _ in range(t):
        n, m = map(int, input().split())
        p = list(map(int, input().split()))
        top = [i for i in range(1, n + 1)]
        ans = [-1] * n
        for i in range(m):
            if p[i] <= n:
                top.remove(p[i])
                top.insert(0, p[i])
            else:
                ans[p[i] - n - 1] = i + 1
        for i in range(n):
            if top[0]!= i + 1:
                ans[i] = -1
        print(*ans)

