    for _ in range(t):
        n, m = map(int, input().split())
        p = list(map(int, input().split()))
        top = [0] * n
        for i in range(m):
            if p[i] <= n:
                top[p[i] - 1] = i + 1
            else:
                top[0] = i + 1
                for j in range(n - 1):
                    if top[j] == 0:
                        break
                    top[j] = top[j + 1]
                top[n - 1] = 0
        for i in range(n):
            if top[i] == 0:
                print(-1, end=' ')
            else:
                print(top[i], end=' ')
        print()

