def solve():
    n = int(input())
    s = input()
    left = 0
    right = n - 1
    while left < right:
        if s[left]!= s[right]:
            if s[left] == '0':
                if right == n - 1 or s[right + 1] == '1':
                    print("No")
                    return
                s = s[:left + 1] + '1' + s[left + 2:right] + '0' + s[right + 1:]
                right -= 1
            else:
                if left == 0 or s[left - 1] == '0':
                    print("No")
                    return
                s = s[:left] + '0' + s[left + 1:right] + '1' + s[right:]
                left += 1
        else:
            left += 1
            right -= 1
    print("Yes")

